import Container from "@mui/material/Container";
import Typography from "@mui/material/Typography";
import Paper from "@mui/material/Paper";
import Stack from "@mui/material/Stack";
import Button from "@mui/material/Button";
import Grid from "@mui/material/Unstable_Grid2";
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';


export default function Header(): JSX.Element {
  return (
    <Paper elevation={2} sx={{
      width: "100%",
      backgroundColor: "#404040",
      backgroundImage:
      'linear-gradient(160deg, #003c5a, #003c5a11), url("./images/tire-trail.JPEG")',
      backgroundSize: "cover",
      backgroundPosition: "center center",
      borderRadius: 0,
    }}>
      <Container sx={{ paddingBottom: 15, paddingTop: 20 }}>
        <Grid container>
          <Grid xs={12} md={8}>
            <Typography variant="h2" color="white" mb={3} sx={{fontFamily: "Krona One"}}>
                <span style={{ color: '#4b94b7' }}>Integrity</span> Well and Drilling Services
            </Typography>

            <Typography variant="h4" color="white" mb={6}>
                Proudly providing reliable, efficient, and high-quality well drilling
                services to the Snowflake, Arizona community.
            </Typography>

            <Stack direction="row" spacing={3}>
                <Button variant="contained" size="large" color="secondary" id="estimate" >Get A Free Estimate</Button>
                <Button sx={{ color: 'white' }} endIcon={<ArrowForwardIcon />}>View Our Services</Button>
            </Stack>
          </Grid>
        </Grid>
      </Container>
    </Paper>
  );
}
